import React from "react";
import WithCard from "components/container/withCard";
import { fetchUsers } from "api/db-init";

type Props = {
  env: string;
};

export default class Saved extends React.Component<Props> {
  state = {
    users: ["berk", "akgün"],
  };

  componentDidMount() {
    const users = fetchUsers(this.props.env);
    this.setState({ users });
  }
  render() {
    console.log(this.state);
    return (
      <div>
        {this.state.users !== undefined
          ? this.state.users.map(() => <WithCard />)
          : null}
      </div>
    );
  }
}
